import React from 'react';
import picture from "./picture.png";
import './App.css';
import {
  roundedCircle
} from "bootstrap"

function App() {
  return (
    <div className="App">
    <Col>
        <img src={picture}   roundedCircle />
        </Col>

    </div>
  );
}

export default App;
